import React from "react";
import { useParams } from "react-router-dom/cjs/react-router-dom";
import UserPage from "./userPage";

const Home = () => {
  const params = useParams();
  const id = params.id;
  if (id) return <UserPage />;
  return <h1>Posts</h1>;
};

export default Home;
